import UIKit

class MovingImageView: UIView {
    
    var verticalLine = CAShapeLayer()
    
    let path1 = UIBezierPath()
    let path2 = UIBezierPath()
    
    override init(frame: CGRect) {
        super.init(frame: frame)
        self.setup()
    }
    
    required init?(coder aDecoder: NSCoder) {
        super.init(coder: aDecoder)
        self.setup()
    }
    
    func setup() {
        self.setupPath1()
        self.setupPath2()
        
//        self.verticalLine.strokeColor = UIColor.blackColor().CGColor
//        self.verticalLine.fillColor = UIColor.clearColor().CGColor
        self.verticalLine.fillColor = UIColor.blackColor().CGColor
//        self.verticalLine.path = self.path2.CGPath
        self.verticalLine.path = self.path1.CGPath
        self.layer.addSublayer(self.verticalLine)
    }
    
    func animatePath() {
        let bounce = CAKeyframeAnimation(keyPath: "path")
        bounce.timingFunction = CAMediaTimingFunction(name: kCAMediaTimingFunctionEaseIn)
        
        let values = [
            self.path1.CGPath,
            self.path2.CGPath,
        ]
        
        bounce.values = values
//        bounce.duration = 2
        bounce.duration = 0.2
        bounce.removedOnCompletion = false
        bounce.fillMode = kCAFillModeForwards
        bounce.delegate = self
        self.verticalLine.addAnimation(bounce, forKey: "return")
    }
    
    
